import React, { Component } from 'react';
import { Link } from "react-router-dom";
import "../index.css";

export class Home extends Component {
  render() {
    return (
      <div className="viewable">
        <h1>Lucky Numbers</h1>
        <h3>
            <p>Enter the name of your lottery.</p>
            <p>Pick up to 6 numbers.</p>
            <p>Save your round.</p>
            <p>Call me if you win. LOL &#128176;</p>
          </h3>
          <br />
          <Link to="/users/new" className="ui inverted yellow button">New User</Link>
          <Link to="/rounds/new" className="ui inverted yellow button">New Round</Link>
      </div>
    );
  }
}

export default Home;
